package com.home.commonBase.constlist.generate;

/** 单位类型(generated by shine) */
public class UnitType
{
	/** 角色 */
	public static final int Character=1;
	
	/** 怪物 */
	public static final int Monster=2;
	
	/** NPC */
	public static final int Npc=3;
	
	/** 宠物 */
	public static final int Pet=4;
	
	/** 傀儡(辅助施法单位)(召唤单位) */
	public static final int Puppet=5;
	
	/** 载具 */
	public static final int Vehicle=6;
	
	/** 场景特效 */
	public static final int SceneEffect=7;
	
	/** 操作体(不可被攻击) */
	public static final int Operation=8;
	
	/** 掉落物品 */
	public static final int FieldItem=9;
	
	/** 建筑物 */
	public static final int Building=10;
	
	/** 掉落物品包 */
	public static final int FieldItemBag=11;
	
	/** 长度 */
	public static int size=12;
	
}
